        a = 1.0 - (b * b + c * c + d * d);
        if (a < 0.0000001) {                   /* special case */

            a = 1.0 / Math.sqrt(b * b + c * c + d * d);
            b *= a;
            c *= a;
            d *= a;        /* normalize (b,c,d) vector */
            a = 0.0;                        /* a = 0 ==> 180 degree rotation */
        } else {

            a = Math.sqrt(a);                     /* angle = 2*arccos(a) */
        }

