    this.orientMat[1][2] = 0;
    this.orientMat[1][3] = ySubtract;

    this.orientMat[2][0] = 0;
    this.orientMat[2][1] = 0;
    this.orientMat[2][2] = zMultiply;
    this.orientMat[2][3] = zSubtract;

