                (this.tempMat[ctrOut][1] * flipMat[1][ctrIn]) +
                (this.tempMat[ctrOut][2] * flipMat[2][ctrIn]) +
                (this.tempMat[ctrOut][3] * flipMat[3][ctrIn]);
